import React from 'react';
import './index.css';

const Card = (props) => {
    return (
        <div className='container bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img className="card" alt='anime' src='../sasuke.jpeg' />
            <div>
                <h2>props.name</h2>
                <p>props.email</p>
            </div>
        </div>
    );
}

export default Card;
